import {React} from 'react';
import '../styles/languagesStyles/languages.scss'

const Languages = () => {
    return (
        <div className = "languageContainer"> 
            <p className="languagesTitle">Languages</p>
            <ul className = "languageList">
                <li className = "languageItem"><p>Armenian - mother language</p></li>
                <li className = "languageItem"><p>Russian - B2-A1</p></li>
                <li className = "languageItem"><p>English - B1</p></li>
            </ul>
        </div>
    )
}

export default Languages;
